# A generic Alembic configuration file.
# Refer to the Alembic documentation for complete information.

[alembic]
# path to migration scripts
script_location = alembic

# template used to generate migration files
# file_template = %%(rev)s_%%(slug)s

# timezone to use when rendering a migration display;
# valid options are "utc" and "local"
# revision_environment = false
# timezone =

# sys.path path, will be prepended to sys.path if present.
# defaults to the current working directory.
prepend_sys_path = .

# Logging configuration
[loggers]
keys = root,sqlalchemy,alembic

[handlers]
keys = console

[formatters]
keys = generic

[logger_root]
level = WARN
handlers = console
qualname =

[logger_sqlalchemy]
level = WARN
handlers =
qualname = sqlalchemy.engine

[logger_alembic]
level = INFO
handlers =
qualname = alembic

[handler_console]
class = StreamHandler
args = (sys.stderr,)
level = NOTSET
formatter = generic

[formatter_generic]
format = %%(levelname)-5.5s [%%(name)s] %%(message)s
datefmt = %%H:%%M:%%S

# sqlalchemy.url
# This is the most important setting.
# It points to your database.
# For the auth_service, this should point to the auth_db.
# It can be overridden by the -x dburl=... command line option
# or by an environment variable if env.py is configured to read it.
# Example: sqlalchemy.url = postgresql://user:pass@host/dbname
# Example: sqlalchemy.url = mysql+pymysql://user:pass@host/dbname
# For async with asyncmy (MariaDB/MySQL):
sqlalchemy.url = ${DATABASE_URL}
# Ensure DATABASE_URL is set in your environment when running alembic commands,
# or set it directly here if preferred for a specific environment.
# e.g. sqlalchemy.url = mysql+asyncmy://user:password@localhost:3306/auth_db

